INSERT INTO `his_config_info` VALUES (0, 2086, 'erahub-biz.yml', 'DEFAULT_GROUP', '', 'spring:\r\n  datasource:\r\n    dynamic:\r\n      # 设置默认的数据源或者数据源组,默认值即为 master\r\n      primary: master\r\n      datasource:\r\n        # 主库数据源\r\n        master:\r\n          type: ${spring.datasource.type}\r\n          driver-class-name: com.mysql.cj.jdbc.Driver\r\n          url: ${datasource.base-master.url}\r\n          username: ${datasource.base-master.username}\r\n          password: ${datasource.base-master.password}\r\n', '65937f03ecca524d1eb35293cf1fef66', '2023-01-01 11:25:16', '2023-01-01 03:25:16', NULL, '127.0.0.1', 'I', 'dev', '');
INSERT INTO `his_config_info` VALUES (172, 2087, 'erahub-gateway.yml', 'DEFAULT_GROUP', '', '# 安全配置\nsecurity:\n  # 验证码\n  captcha:\n    # 是否开启验证码\n    enabled: true\n    # 验证码类型 math 数组计算 char 字符验证\n    type: MATH\n    # line 线段干扰 circle 圆圈干扰 shear 扭曲干扰\n    category: CIRCLE\n    # 数字验证码位数\n    numberLength: 1\n    # 字符验证码长度\n    charLength: 4\n  # 防止XSS攻击\n  xss:\n    enabled: true\n    excludeUrls:\n      - /basicservice/notice\n  # 不校验白名单\n  ignore:\n    whites:\n      - /code\n      - /auth/logout\n      - /auth/login\n      - /auth/smsLogin\n      - /auth/xcxLogin\n      - /auth/register\n      - /auth/blogLogout\n      - /auth/blogLogin\n      - /auth/blogSmsLogin\n      - /auth/blogRegister\n      - /basicservice/sms/code\n      - /*/v3/api-docs\n      - /csrf\n\nspring:\n  cloud:\n    # 网关配置\n    gateway:\n      # 打印请求日志(自定义)\n      requestLog: true\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: erahub-auth\n          uri: lb://erahub-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - ValidateCodeFilter\n            - StripPrefix=1\n        # 系统工具\n        - id: erahub-base\n          uri: lb://erahub-base\n          predicates:\n            - Path=/tool/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: erahub-base\n          uri: lb://erahub-base\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 基础服务\n        - id: erahub-base\n          uri: lb://erahub-base\n          predicates:\n            - Path=/basicservice/**\n          filters:\n            - StripPrefix=1\n        # 博客服务\n        - id: erahub-blog\n          uri: lb://erahub-blog\n          predicates:\n            - Path=/blog/**\n          filters:\n            - StripPrefix=1\n        # 演示服务\n        - id: erahub-demo\n          uri: lb://erahub-demo\n          predicates:\n            - Path=/demo/**\n          filters:\n            - StripPrefix=1\n        # MQ演示服务\n        - id: erahub-stream-mq\n          uri: lb://erahub-stream-mq\n          predicates:\n            - Path=/stream-mq/**\n          filters:\n            - StripPrefix=1\n\n    # sentinel 配置\n    sentinel:\n      # nacos配置持久化\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr}\n            dataId: sentinel-${spring.application.name}.json\n            groupId: ${spring.cloud.nacos.config.group}\n            namespace: ${spring.profiles.active}\n            data-type: json\n            rule-type: flow\n', '8453788c1a811abe88f204c1e07a9c8e', '2023-01-01 11:26:39', '2023-01-01 03:26:40', 'nacos', '127.0.0.1', 'U', 'dev', '');
